clcdisp('')disp('')rawdata = csvread('results3.csv');rawdata = rawdata(:,3:10);ind = rawdata(:,1) != 0;data = rawdata(ind,:);percentage = zeros(size(data));for i=1:size(data,1)  percentage(i,:) = 100*(data(i,:)/sum(data(i,:)));endavg = sum(percentage)/size(data,1);msg = sprintf("conf correct\t\t\tconf incorrect");disp(msg);msg = sprintf("0\t1\t2\t3\t0\t1\t2\t3");disp(msg);msg = sprintf("%.3f\t%.3f\t%.3f\t%.3f\t%.3f\t%.3f\t%.3f\t%.3f",avg(1),avg(2),avg(3),avg(4),...        avg(5),avg(6),avg(7),avg(8));disp(msg);sum(avg(2:4));sum(avg(6:8));disp('')disp('')